package nestedloops;

public class nestedfor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i, j, k;

		for (i = 0; i < 2; i++) {
			for (j = 0; j < 1; j++) {
				System.out.print("\n" + 1 + " " + 2);
			}

		}
		System.out.println("\nThank You");
	}

}
